    //console.log ( counterState [1])

    const sumar = ()=>{
        setContador(contador + 1)
    }
  return (
    <div>
        <h1>Estoy en itemCount</h1>
        <h2>{contador}</h2>
        <button onClick={sumar}>Sumar</button>
        <button>Restar</button>
    </div>
  )
}
